import React from 'react';



function Molde() {
    return (


        <div>
            <input type="checkbox" id="check" />
            <label for="check">
                <i className="fas fa-bars" id="btn"></i>
                <i className="fas fa-times" id="cancel"></i>
            </label>
        </div>



    )
}

export default Molde;
